resources.string:
रक्त ऑक्सीजन माप कैसे लें:
1. घड़ी को कलाई की हड्डी के नीचे एक उंगली की चौड़ाई में पहनें, और इसे कलाई पर आरामदायक स्थिति में पहनें; 
2. ब्लड ऑक्सीजन डिटेक्शन मोड में प्रवेश करने के बाद, कृपया स्थिर रहें, सुनिश्चित करें कि आपकी कलाई सपाट है और घड़ी ऊपर की ओर है। यदि आप बैठे हैं, तो आप अपनी बाहों को मेज पर रख सकते हैं, अपनी घड़ी को ऊपर की ओर करके; 
3. कृपया अंतिम परिणाम प्राप्त होने तक अपना हाथ स्थिर रखें।
